function windowOnload(){if(window.parent)for(var a="main-link-selected",e=window.parent.location.pathname.split("/"),n=document.getElementsByClassName("clickable-main-link"),i=0;i!=n.length;){var t=n[i].attributes.getNamedItem("href").value.split("/");if(t[1]==e[1]){n[i].classList.add(a);break}i++}}window.onload=windowOnload;